document.addEventListener('DOMContentLoaded', function() {
    document.querySelectorAll('.download_invoice').forEach(button => {
        if (!button.hasAttribute('data-clicked')) {
            button.setAttribute('data-clicked', 'true');
            button.addEventListener('click', function(event) {
                event.preventDefault();
                const orderId = this.getAttribute('data-order-id');
                generatePDF(orderId);
            });
        }
    });

    function generatePDF(orderId) {
        console.log(`Отправка запроса к /js/data.php для заказа ID: ${orderId}`);
        
        fetch(`/js/data.php?order_id=${orderId}`, {
            method: 'GET',
            headers: {
                'Content-Type': 'application/json'
            },
        })
        .then(response => {
            console.log('Ответ сервера получен:', response);
            
            if (!response.ok) {
                throw new Error('Ошибка при получении данных с сервера: ' + response.statusText);
            }
            
            return response.json();
        })
        .then(data => {
            console.log('Данные преобразованы в JSON:', data);
            
            if (data.error) {
                throw new Error('Ошибка: ' + data.error);
            }
            
            if (data.hasOwnProperty('order') && typeof data.order === 'object' && data.hasOwnProperty('user')) {
                createPDF(data.order, data.user);
            } else {
                console.error('Ошибка: структура данных неверна или order не является объектом', data);
            }
        })
        .catch(error => {
            console.error('Ошибка при получении данных:', error.message);
        });
    }

    function createPDF(order, user) {
        const { jsPDF } = window.jspdf;
        var doc = new jsPDF('l');
        doc.addFileToVFS("fonts/LiberationSans-Regular.ttf", "");
        doc.addFont("fonts/LiberationSans-Regular.ttf", "LiberationSans", "normal");
        doc.setFont("LiberationSans");

        doc.setFontSize(12);
        doc.text("Внимание! Оплата данного счета означает согласие с условиями поставки товара. Уведомление об оплате", 10, 10);
        doc.text("обязательно, в противном случае не гарантируется наличие товара на складе. Товар отпускается по факту", 10, 15);
        doc.text("поступления денег на р/с Поставщика, самовывозом, при наличии доверенности и паспорта.", 10, 20);

        // Добавляем информацию о пользователе
        doc.text(`${user.name}`, 10, 50);

        doc.setFontSize(14);
        doc.text(`Счет на оплату № ${order.Orders_ID}`, 10, 60);

        doc.setFontSize(8);
        doc.text(`Поставщик ${order.supplier}`, 10, 70);
        doc.text(`Получатель: ${user.name}`, 10, 80);
        // doc.text(`Наименование: ${order.Orders_Title}`, 10, 70);
        // doc.text(`Сумма: ${order.Orders_Price} руб.`, 10, 80);

        // Заголовок таблицы
        doc.setFontSize(10);
        doc.text("№", 10, 90);
        doc.text("Товары (работы, услуги)", 20, 90);
        doc.text("Кол-во", 140, 90);
        doc.text("Ед. изм.", 160, 90);
        doc.text("Цена", 180, 90);
        doc.text("Сумма", 200, 90);

        // Проверяем наличие элементов в заказе
        if (Array.isArray(order.items) && order.items.length > 0) {
            for (let index = 0; index < order.items.length; index++) {
                let item = order.items[index];
                let y = 100 + (index * 10);
                doc.text((index + 1).toString(), 10, y);
                doc.text(item.description, 20, y);
                doc.text(item.quantity.toString(), 140, y);
                doc.text(item.unit, 160, y);
                doc.text(item.price.toFixed(2), 180, y);
                doc.text(item.total.toFixed(2), 200, y);
            }
        } else {
            doc.text('Нет товаров в заказе.', 20, 100);
        }

        // Общая сумма и информация о НДС
        doc.text(`Итого:`, 160, 140);
        doc.text(order.totalAmount.toFixed(2), 200, 140);

        doc.text("Руководитель _______________", 10, 160);
        doc.text("Бухгалтер _________________", 110, 160);

        doc.save(`Agency_Счёт № ${order.Orders_ID}.pdf`);
    }
});
